forests. Among these natural beauty, U Minh National Park, laying right beside the Gulf of Thailand, is the habitat of many unique animals and plants. In terms of cultural heritages, the most visited destinations are Tan Hung Temple and Quan Am Pagoda.\r\n                                HON KHOAI ISLAND\r\n   Location: Hon Khoai Island\r\n   Best for:	\r\n   Entrance: Free\r\n   Hours:\r\n   Only 14.6 km away to the southwest of Nam Can Town, the Hon Khoai Island is located in Ngoc Hien District of Ca Mau Province\r\nOnly 14.6 km away to the southwest of Nam Can Town, the Hon Khoai Island is located in Ngoc Hien District of Ca Mau Province.  This is a stone island on which the hills and the forest still remain untouched with many specious types of wood, animal, and plants, as well as a mesmerizing artless wilderness.\r\nThree enjoyable hours on the 90CV cruise from RachGoc (the gate to the East Sea of Ngoc Hien District) will take you to the spectacular Hon Khoai Island, one of the most beautiful islands in the Southern-most region of the country. You should not confuse Hon Khoai Island with Hon Khoai archipelago, which is a group of 5 spectacular islands. The Hon Khoai Island is the biggest and also the highest island surrounding by the other four.\r\n   Setting foot on Hon Khoai Island enables all tourists to enjoy the poetically beautiful seashores that are full of white egg-shaped cobbles. Tourists can also challenge their bravery by climbing up the mountains or discovering the tropical jungle. However, no matter what they do, the rare and priceless scenery of primitive forest with more than 1000 types of plants and hundreds species of wild animal will surely leave them speechless from time to time.\r\n   Nowadays, on the highest peak of Hon Khoai Island still stands a beautiful lighthouse built by the French at the end of the 19th century. This is the place where a revered teacher named Pham Ngoc Hien led a group of prisoners to success over the French leader of the island, which resulted in their ownership of the lighthouse. This is a wondrous exploit that always appears in the local tales today. From this lighthouse, visitors can use the telescopes to look closely at one of the 5 surrounding islands called Hon DoiMoi, which resembles a tortoise swimming in the middle of the ocean. However, the most special thing is that they can also use the telescopes to have a look at the Cape of Ca Mau, to once in their life known how beautiful the cape is from afar. Without coming to Hon Khoai, such opportunity would be nearly impossible!\r\n\r\n                            The Cape of Ca Mau\r\n   The Cape of Ca Mau belongs to Ngoc Hien District in Ca Mau Province\r\nThe Cape of Ca Mau belongs to Ngoc Hien District in Ca Mau Province. It locates only 118km away from the center of Ca Mau City. This is a unique spot of Vietnam Tourism not only because of its southern-most location, but also because of the fact that it is the only place in Vietnam where one can see the sun rising in the East and setting in the West.\r\n The cape was discovered at the end of the 17th century. As it is the residential area of three ethnic groups: Viet (Kinh), Hoa, and Khmer, it is the place where many aspects of the three cultures interact and converge, reflecting in many unique traditions and customs.\r\n The natural scenery full of mangrove forests featuring a plethora of birds, wild animals, and fishes gives Ca Mau a very distinctive beauty of a newly discovered land: mysterious and fresh at the same time. With a diverse system of wild plants and animals, the giant mangrove forests are surely the most noticeable feature of this land, as they are the intersection of the East Sea and the West Sea. As the area of the forest expand greatly on a yearly basis, the most precious types of plant also develop, benefiting the wild animals residing there. It is estimated that there are over 240 types of plants, 36 species of animal, 194 species of bird, and 260 species of fish, with many endangered species.\r\n From the Cape of Ca Mau, one can see the Hon Khoai Archipelago which is 20km away from mainland. This is a huge cluster of beautiful islands such as Hon Tuong, Hon Sao, Hon Kho, Hon Lon, Hon Doi Moi, etc., among which the Hon Khoai Island is the biggest and highest with a width of 4km2 and a height of 318m. But don’t just stand still and look, come to this amazing island! This is where you can find the most important (and probably the most romantic) lighthouse in the Gulf of Thailand and the East Sea!                        \r\n   	                          Source: vietnamonline.com', 'Ca Mau', '2017-03-15 07:32:38', '2017-03-15 07:32:38');
