VWNY8/gu5hz5VxuA6K2a9KcBskiq7IoTdgZqlUm/dbv6lqKZ5ZdaNfQg7\n7QSf7SuTWZPHbRlhMrwk/wB9DmvW2jXcRjis6+tYWG1o1cf7Sg1L5GuVxF7y2Z5M9hYzgBJoG9n4\n/nWPN4YgnZhHEHOeDEwNeqXnhzTrkNutUHP8PFcrrnhmz09HNv5kef8Aaz/MVzzwGFqfFH+vwB15\n0t9Tgj4YRZn2716dqKmFzLFM6rIwFFJ8PUO/5/5mn1p9j//Z\n', '   Phu Quoc is the largest island of Vietnam, located in Thailand Bay. Phu Quoc has Phu Quoc national park with many wonderful scene and lovely animals/plants, and also has its own unique specie: Phu Quoc dog, one of the oldest dog breed in the world, loves to climb up trees and catch fishes properly. Moreover, coming to Phu Quoc, visitors have their chance to witness one of the most terrible prisons in the history: Phu Quoc’s Prison, also called Coconut Tree Prison. This place nowadays still keeps many torturing tools that used to torture Viet Minh in the past. Phu Quoc prison brings the picture of a hell in Earth, where people were treated like objects! It’s horrible, but it is worthy to witness once in lifetime.\r\n\r\n                             Phu Quoc Beaches\r\n   Location: Phu Quoc\r\n   Best for: Family, couple, solo\r\n   Entrance: Free\r\n   Hours: All hours\r\n   Coming to Vietnam, tourists shouldn’t miss Phu Quoc - one of the most beautiful islands - and undoubtedly the largest one in Vietnam. Phu Quoc belong to the administrative division of Kien Giang province and is located in the Gulf of Thailand. Phu Quoc is probably most famous for its pristine beaches with white sands, calm sea, warm water, bright sunny paradise and other mysteries of nature. All are waiting for you to discover.\r\n   Coming to Vietnam, tourists shouldn’t miss Phu Quoc - one of the most beautiful islands - and undoubtedly the largest one in Vietnam. Phu Quoc belong to the administrative division of Kien Giang province and is located in the Gulf of Thailand. Phu Quoc is probably most famous for its pristine beaches with white sands, calm sea, warm water, bright sunny paradise and other mysteries of nature. All are waiting for you to discover.\r\n   Phu Quoc beaches that lie along the shore from North to South. You may wonder which one is your favorite destination? Below are some for you to choose from:\r\nTruong beach: an attractive beach of Phu Quoc island with white sandy beach lying 20km from Dinh Cau to Tau Ru beach. Various kind of seafood is an ideal condition for fishermen to do their fishing near beach. Tourists will have a chance to watch them doing their work and try raw seafood from nature.\r\nGanh Dau beach: is in the North of Phu Quoc island and near the territory of Cambodia. Going from Duong Dong town to the North and across Phu Quoc National Forest, you will see a beautiful beach before your eyes: deep blue ocean and white sand. Standing at Ganh Dau beach, you can see Ta Lon mountain of Cambodia. Don’t forget to try seafood paradise.\r\n   Sao beach: is in the South near An Thoi harbor and 30 km from Duong Dong town. This beach is very calm. There are just few vendors; so tourist can enjoy their vacation fully. The service quality here is very good with restaurants and basic utilities such as the beach umbrella and chair...\r\nVung Bau beach: an idyllic beach in the North of island and near Dai beach. It’s 40km from Duong Dong town and suitable for those who want to discover ecological beach.\r\n   Bai Thom beach: an uninhabited beach in the North East of Phu Quoc. It takes you 35km from Dong Duong town to get there. This beach is quite sparse and remote make it an ideal place for adventurous people.\r\nBai Vong beach: It’s 8km from Duong Dong town. Bai Vong beach is a broad and shallow beach with white sand and a long line of palm. Tourist can enjoy sunny beach and try local food. Remember to bring sunglasses and sun cream to protect your skin if you don’t want to get burnt. It is also a good place to shoot best photos.\r\n\r\n                            Tranh Stream\r\n   Location: Phu Quoc\r\n   Best for: Family, Solo\r\n   Entrance: VND 30,000/adult\r\n   Hours: All hours\r\n   Tranh Stream is a terrific spot that tourists who once have chance to drop by Duong Dong town, Phu Quoc island district, should not miss out\r\nAbout Tranh Stream\r\n   Tranh Stream is a terrific spot that tourists who once have chance to drop by Duong Dong town, Phu Quoc island district, should not miss out. The 15km long stream which originates from Ham Ninh Mountain flows through diverse terrain in the forests to create beautiful waterfalls. White waterfalls flowing down in the greenery of the forest certainly draw a picturesque scene in front of the tourists’ very eyes. Perhaps, the name Tranh (picture) stems from the spectacular gorgeousness of the stream and surrounding scenery.\r\n   After just 15 minutes driving motorbike from Duong Dong town, tourists will reach Tranh Stream, an ideal place for relaxing picnics and camping trips at the weekend. Campers may take along some foods, set up a camp beside the stream, and then walk into the forest for sight-seeing, flora and fauna or bird watching.  It is much more interesting for visitors to hike through the forest on their own way, otherwise follow the available small paths with rocky steps along the stream. After a long hiking trip enjoying birds’ songs and orchid’s beauty, a grotto named “Hang Doi” (Grotto of Bat), which is 200 meters high on the mountain and the home to beautiful stalactites is supposed to be the next inviting site for tourists. Then, the travelers possibly will plunge into the cool stream for relaxation, and come back the camp for lunch at noon.\r\nOther things to see\r\n   Tourists who come to Tranh Stream definitely are surprised by a strange species of fish with the weight of 10kg, caught in Tranh Stream by the local in 2008. The fish has special dots on the head similar to the monk’s head and the tail always floats on the water when swimming. It is said that the fish is so rare and the local people do not see such an odd fish for a long time. Though a foreign tourist offered $1000 for the fish, it is still raised by the local tourism management team for exhibition purpose. Hence, tourists can go to Tranh stream and contemplate the special fish freely.\r\n                             \r\n                              The Coconut Tree Prison\r\n   Location: Phu Quoc\r\n   Best for:\r\n   Entrance:\r\n   Hours:\r\n   The coconut tree prison which is also known as “Phu Quoc Prison” is located in An Thoi Village, Phu Quoc.\r\nHistory and location\r\nThe coconut tree prison which is also known as “Phu Quoc Prison” is located in An Thoi Village, Phu Quoc. The name “coconut tree” originated from the Indochina War; when French colony was dominating Vietnam and the resistant war against French becomes very strong. At this time, the prison had four areas named “A”, “B”, “C” and “D”; which was believed to keep over 14,000 prisoners. However, when the Indochina War finished, most of the prisoners returned to their families according to the Geneva Accords.\r\n   As the Vietnam War started, the U.S troops rebuilt the place into a new prison but kept the same name. The new prison had separate areas for men, women and the elder. As time passed by, until 1966, a new part of the prison was built to imprison more Vietnamese soldiers. The new part of the prison had 12 main areas. Each area was divided into four different sub-areas “A”, “B”, “C” and “D”. The protection security was very strict with tight supervision all the time.\r\nNowadays, “The coconut tree prison” has become a place for tourists to visit since 1996. In the same year, it was recognized as a “national historical heritage”.\r\nSignificances\r\n   The Coconut Tree prison is the living evidence for the war crime. There are plenty of exhibits presented in the prison for visitors to learn more about the war. There are still some torture tools that was used in the past on prisoners. For example, you can witness the “Catso Tiger cage” which was used to capture the prisoners inside. Since it was closed all the time, the cage was completely dark and it is extremely hot in the morning while completely cold at night. The prisoners after being released from the Tiger cage would be blind. His/her physical and mental health conditions were strongly affected. Besides, there are more torturing activities which reflects the cruel inhuman activities of the enemies in the past like crucifixion, boiling people till death or directly breaking one’s teeth with hammer waiting for you to witness.\r\nVisitor information\r\n   Every year, the coconut tree prison attracts about 10,000 visitors. Many of them are former-prisoners. There are also a lot of young people and especially the foreigners coming here to know more about the destructive war in the past and appreciate the peaceful life we all have now.\r\nVisitors can pass by the coconut tree prison with the tour. However, you can also visit here by yourself. The tour guide service is always available if you ask.\r\n                                               Source: vietnameonline.com', 'Kiên Giang', '2017-03-15 07:43:29', '2017-03-15 07:43:29');
