eBj\nGcDBPAqLxdoNporbp5rqZcIIY1jxFHyWf5hwDgnhSCTkEdDWMPdm41G21sJu53Hw2+K3iXwfpNpY\neH7xLfT5GcXlrJKJIXdo2jLvGefusQCv0PIrr/ih+1Lc/Gvwro3hnxBp1r4g1XT5S2n65NGVuoSF\nVQgVSCQxQ7lOQxKngjNeQWN9BNCU0q+byEO4rcbl3lTwCmSAT0BHHJB65qpc+F5dGit9clmyl44k\neC3k2y287ElgsfUYJABHIBIycVTbu03bsu5LjdXWhevbG+tZxEwnjuyI5IbeWIwmRWJAK54IBBzk\njByBkc1l3Flqtlq8trfadLb3to5kuBcQNHLGMYIPGcjAxjrnj1HVaa+gPoEM01vdS6u8rGa6F0+G\nUENGIxjIZFwGOTkswwNtM1O80a6SYS2beZgyySSykysTnGCSCTnHPBJPTmuaNRwfJZvo3YpRst7v\nfQ9W0L4ZeGdU+DEnizTYdO+1aSTHqG5ZDdTBwoQyJkqAJWQFsqFG4nccKa3wH+HXhH4h2Wt2GrXo\nttY062kufskjCO2CqABK0pUgYJBxkkhWyBwR4bpXjzUPBer3DaNdXtuk1vc2EsccjpI0TrhlJXqo\nO1iMkEqCQMcZ1lo+vWrrqNnOltcSHeI2co6gEEMeMD6Z4HJ4rN4WryyUqlru6fVeXoepDE0nKEnB\nOys1bR+Z9UeD/hz4O8D/AB1vdE1DxdpjaXocp+1wzJ5jXsyx5CW6xhkZCxBILAgHac7Sa84+KXie\n2tfEF3aafJFLKTA73VshjyPIUoswYK0bRhjGwGQShIJBBOTfX3hC18FTWllHqY8SidZReSyx+RJC\nqhQoxkklQOBjHI5ArkU1iLXILqz+yeZdSujR3EcahwUBTaXb+HaTkDklVz0xWNGhJz55NtJWs9F5\nv5lV6sPZ8kUlre6d/kbB+N2q3Op2ttLeTXOQLbMbnK424AycEN1ySOcHJ5rSHim904q4luba5gLG\nGSKcYQDgEnkAYJzkjJPpyOLPg19CvDeW1wl7csTtS1YgoCCcEHA5AIJzwe3INWrCxeR7vULi7EVh\nEMyoZd0gyeBgYAwcYyema6/ZUbJ09vzPJV2rdDTF7H4jkVNTcQzuSUlGcRsD0BAwwzj5Qe/Haiq2\niI93auLSSW6tmBEkksZRABxnJOMjqcdenJ4oqXJRdr2NIqbV7M//2Q==\n', '  Nam Du is the most remote archipelago in Kien Hai District (Kien Giang province), which is far about 83 km from Rach Gia city, located in southeast of Phu Quoc island and in the Gulf of Thailand. Nam Du remains its’ wildness, with 21 islands, which are cleverly arranged by Mother of Nature. There is a more than 300 m peak in the largest island, Nam Du. It is nice that chunks of the islands in the archipelago are interwoven, which forms a solid ball in the ocean. The whole archipelago is under the management of An Son and Nam Du Commune. It is currently one of the favorite destinations of young travellers. .\r\n   Attractions in Nam Du island\r\n\r\nYou should rent a motorbike to travel in Nam Du, price about $8 – $10 / day, You can ask your hotel. \r\n\r\n1. Nam Du lighthouse (on peak of Hon Lon) is 2.5km (1.5miles) from Nam Du dock. You can get the lighthouse by walking (very tired), motortaxi (hugged vehicle, about $4/pax both off and on) or motorbike (you should be a good motorbike driver, because of very steep road). \r\n\r\n2. Cay Men beach (bãi Cây Mến) is most beautiful beach of Nam Du archipelago with green row of coconut, white sands and blue sea. \r\n\r\nVisit islets in the archipelago\r\n\r\nTo get islets, you have to rent a boat. If you travel in big group (about 10), you can contact Mr. Ngai, +84163.6977.859 or Mr. Phong Vu, +8491.9138.369. Else, there’re many fish boat at the Nam Du dock, you can rent 0ne with good price. \r\n\r\n3. Hai Bo Dap (Hòn Hai Bờ Đập) is a beautiful islet, small waves, suitable for fishing and camping. \r\n\r\n4. Nom islet (Hòn Nồm) is very pristine, often uninhabited, however, very difficult to dock on the islet because of many reefs. \r\n\r\n5. Son Islet or Son Rai islet (Hòn Sơn) has many residents and good roads. You should rent a motorbike to stroll around islet. Price about $8 – $10 / day, however, you need to rent just half day, it’s enough to visit all sites on islet. If you want to take overnight in the islet, it’s fine, you can consult few good hotels on Son Islet.\r\n                                   Source: http://www.vietnamtriptips.com', 'Kien Giang - VietNam', '2017-03-15 07:48:04', '2017-03-15 07:48:04');
