ab/FQhp3EGf4VoH3Szf9805ehpo/joKAc5Zvmo\nH+z8tFFABs9qKKKAP//Z\n', '   How to get to Nam Du island\r\n\r\nBasically, way to get Nam Du is similar to Phu Quoc. You have to get Rach Gia from Ho Chi Minh city by bus  (take about 6 hours) then keep going to Nam Du by boat. \r\n\r\nFew reputed bus firms to get Rach Gia:\r\n\r\n1. Mai Linh in Mien Tay bus station (395 Kinh Duong Vuong – Binh Tan – Ho Chi Minh city). Tel: +848.39.29.29.29\r\n\r\n2. Phuong Trang bus in Mien Tay bus station, Tel: +84838.309.309\r\n\r\n3. Tuyet Hon in Mien Tay station, +84773.960.960\r\n\r\n4. Kumho Samco in Mien Tay station, +8483.8776.594\r\n\r\nYou can pick many others in Mien Tay bus station (395 Kinh Duong Vuong – Binh Tan – Ho Chi Minh city) with fare is less $10. \r\n\r\n>> Click Here to check all hotels in Sai Gon city\r\n\r\nGet Nam Du by boat\r\n\r\nTo catch boat, you have to be present at dock before 8am. You can consult Ngoc Thanh speedboat, add: 456 Mac Cuu street – Rach Gia city, tel: +8477.3863.019 or +8491.8914.188. You will arrive Nam Du station (on Cu Tron islet) at 11am. \r\n   \r\n   Hotels in Nam Du\r\n\r\nIn Hon Lon (the Largest Island)\r\n\r\n1. Kim Yen motel, 5$/double room/day, tel: +8493.9486.262 . The motel is close to sea, nice view, good room. I vote for this motel. \r\n\r\n2. Thuy Diep motel is near market, price about $6/doube room, has karaoke room, tel: +8477.3830.853 or +84914.499.863. Although the motel is slightly old but clean, and has karaoke room. \r\n\r\n3. Sau Co motel is near the dock, +84773.690.225 or +84907.172.656. Price about $5/room. \r\n\r\nIn case you can’t find any room, don’t worry, let’s ask the locals finding room for you, or take overnight in their home, some of them will agree (with a small cost). \r\n\r\nIn Son Islet\r\n\r\n4. Hong Dao hotel, $8/room/day, tel: +8477.3830.597 or +8491.203.9597. The islet is quite small so easy to find. Addition, the hotel has Vuon Xoai cafe (Mango Garden cafe), very nice. \r\n\r\n5. Hong Hai motel is near market. I don’t know the price because not staying. \r\n\r\n   Restaurants in Nam Du\r\n\r\nThe tourist services on Nam Du island hasn’t developed, so there’re not many choices for restaurants. \r\n   In Hon Lon\r\n1. Nam Nuong rice (cơm Năm Nương), after arriving in the island (about 11am) by speedboat, you can have lunch at this restaurant. It’s close to the dock, quite small but tasty and cheap foods, about $2 – $2.5 / plate. Evening, you can also ask Mrs. Nam (the owner) for buying and cooking seafoods. \r\n\r\n2. Restaurants on Chet beach (close to the dock). There’re many breakfast restaurants at here. You can also have breakfast at Nam Nuong restaurant, they sell noodle and rice in the morning. \r\n\r\n3. Mrs. Yen, the owner of Kim Yen motel that i mentioned above, you can contact her (+8493.9486.262) to book meals. The dishes are cooked like family meal with price about $2.5 / pax. \r\n   In Hon Son\r\n4. Restaurants on Bai Nha beach (Bãi Nhà). You can eat at here, or contact Mr. Nhuan, \r\nhe has the service like Mrs. Yen. Addition, you can also ask for eating at a home of locals, just pay for them. \r\n5. Seafood. You should ask the place where you book meals, or buy seafood in the market then bring to Bai Bang beach and ask a certain restaurant cooking. Note, Bai Bang beach does not sell seafood, they just cook for remuneration. \r\n                               Source: http://www.vietnamtriptips.com', 1, '2017-03-15 01:45:33', '2017-03-15 01:45:33');
