 at 328, Le Hong Phong, District 10 or at the Mien Tay Bus Station. Tuan Hung and Mai Linh pick you up if you are in inner urban Ho Chi Minh City.\r\n\r\nFrom Rach Gia there are hydrofoils leaving Rach Gia at 14:00 (110,000 dong, 3 hours) and several buses.\r\n  BUY\r\nCo-op Mart is downtown, on Tran Hung Dao St.\r\n\r\n  EAT\r\nLang Toi on Nguyen Trai St.\r\nPho Xua, Phan Ngoc Hien St, good Vietnamese food.\r\nThanh Truc, next to Pho Xua, good Vietnamese food.\r\n\r\n   DRINK\r\nBar New World (Near the airport). Dancing. Heineken, 70,000 dong. edit\r\nBar Nguyen (Near Ganh Hao Bridge). Dancing. edit\r\nChuong Gio Cafe (Downtown).  edit\r\nHuynh Huong Cafe (Downtown).  edit\r\n \r\n  HOTEL\r\nÁnh Nguyệt, 207 Phan Ngoc Hien, ☎ +84 780 3567666, fax: +84 780 3567547.  edit\r\nBest CM, 463C Nguyễn Trãi, ☎ +84 780 3829828, fax: +84 780 3829818. ', 1, '2017-03-15 07:32:08', '2017-03-15 07:32:08');
