rt of the Mekong Delta, in Vietnam. There''s not an enormous amount to do, but it''s a wonderful place - small, cheap, rather unspoiled and very friendly. It''s dominated by a large Indoor Market. If you''re the type that prefers markets to malls, you''ll love it.\r\n\r\n   Buy:\r\nThere are many ATM, mainly in center near the pagoda, and on Le Loi / riverside.\r\n   Eat:\r\nThanh Tinh, 13 Quang Trung (close to the indoor market). 6AM-9PM. A nice and clean local restaurant that serves vegan food. Friendly and English speaking staff. They can also prepare take-away meals (handy for the journey on the slow boat to Cambodia). Be aware, they charged 95,000 VND for a ''COM PHAN'', almost three times expensive than usual price. (March, 2011) 25,000-40,000.  edit\r\nBay Bong, 22 Duong Thuong Dang Le (With the indoor market on your right hand side, continue until you can only go left or right. Go right there and you''ll eventually see it on your left.),(076) 867 271. Good food here with a very long menu. Locals eat here as well. The atmosphere isn''t particularly romantic, but still. 25,000-55,000.  edit\r\n6 Hiệp-Nem, Nguyễn Văn Thoại,0763 561 461. Family restaurant,friendly,fair price, 40.000đ/pax at the moment,local Nem, good food.  edit\r\nLiên Phát Restaurant., Trưng Nữ Vương str,Ward B,Châu Đốc,An Giang.,0763 566 868. New restaurant,quiet place,vans,car can park,CLEAN and good food,price fairy,staffs are helpful.\r\n   Drink:\r\nCoffee GÓC PHỐ, 86,Đống Đa str, Châu Đốc, 076 6267 888.. New coffee Shop,good services,clean,with a/c.Easy enjoy the view from the top of building, price OK.  edit\r\nMemory Delicatessen, 57, Nguyen huu Canh, Phuong A,0917 7777 91. Very central,easy to find, provides coffee or cakes, with nice music,a/c; friendly staff, good service, fair price, clean; with table and chairs to seat out,enjoying a cool beer.\r\n   Sleep\r\n Trâm Anh hotel., Sam mountain,+84 909020282. checkin: 10 am; checkout: 12 noon. Nice to stay 1 night, can walk to visit the Lady temple also sun set on top of the mountain,food around here. The staffs are helpful even not seaking English,good coofee here. 300.000 đ.\r\n   ', 1, '2017-03-15 07:44:30', '2017-03-15 07:44:30');

